  ///  Exercise Description Strings
  'ex_desc_1': "သင်၏လက်များကို ဆန့်တန်းထားပြီး ကြမ်းပြင်ပေါ်တွင် မတ်တပ်ရပ်ပါ\nပုခုံးအမြင့်ရှိ ဘေးဘက်သို့ တည့်တည့်မတ်တပ်ရပ်ပါ။\n\nသင့်လက်မောင်းများကို စက်ဝိုင်းကြီးအတွင်း နာရီလက်တံအတိုင်း အမြန်ရွှေ့ပါ။\n\nတတ်နိုင်သမျှ မြန်မြန်လုပ်ကြည့်ပါ။\n\nဒါက လေ့ကျင့်ခန်းကောင်းတစ်ခုပါ။ deltoid ကြွက်သား။",
  'ex_desc_2': "ခြေဖဝါးနှစ်ဖက်ကို တွဲလျက် လက်နှစ်ဖက်ဖြင့် စတင်ပါ၊ ထို့နောက် ခြေနှစ်ဖက်ကို ခွာကာ လက်နှစ်ဖက်ဖြင့် ခေါင်းပေါ်မှ ခုန်တက်ပါ။\n\nစတင် အနေအထားသို့ ပြန်သွားပြီး နောက်တစ်ကြိမ် ထပ်လုပ်ပါ။\n\nဤလေ့ကျင့်ခန်းသည် တစ်ကိုယ်လုံး လေ့ကျင့်ခန်းကို ပံ့ပိုးပေးပြီး၊ သင်၏ကြီးမားသောကြွက်သားအုပ်စုအားလုံးကိုအလုပ်လုပ်သည်။",
  'ex_desc_3': "ခြေဖဝါးနှစ်ဖက်ကို မတ်တပ်ရပ်ပြီး လက်နှစ်ဖက်ကို ဘေးချင်းကပ်ကာ မတ်တပ်ရပ်ပါ။\n\nခြေတစ်ဖက်ကို ဘေးဘက်သို့ လှမ်းထုတ်ကာ လက်နှစ်ဖက်ကို မြှောက်ကာ လက်နှစ်ဖက်ကို ခေါင်းပေါ်တင်ပါ။\n\nပြန်သွားကာ ဘေးနှစ်ဖက်ကို ပြောင်းကာ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_4': "သင့်ခြေထောက်များကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပြီး သင့်လက်မောင်းကို ရှေ့သို့ဆန့်ထုတ်ကာ သင့်ပေါင်များကို ကြမ်းပြင်နှင့်အပြိုင် ကြမ်းပြင်နှင့်အပြိုင်ရောက်သည်အထိ သင့်ခန္ဓာကိုယ်ကို နှိမ့်ချလိုက်ပါ။\n\nသင့်ဒူးများကို သင့်ခြေချောင်းများအတိုင်း ဦးတည်ထားသင့်သည်။\n\nစတင်အနေအထားသို့ ပြန်သွားရန်။ ပြီးလျှင် နောက်တစ်ကြိမ် ထပ်လုပ်ပါ။\n\n၎င်းသည် ပေါင်၊ တင်ပါး၊ တင်ပါး၊ လေးထောင့်၊ တံကောက်ကြောနှင့် ခန္ဓာကိုယ်အောက်ပိုင်းတို့ကို လုပ်ဆောင်သည်။",
  'ex_desc_5': "သင့်တင်ပါးအောက် ဒူးလေးခုလုံးနှင့် သင့်ပခုံးအောက် လက်နှစ်ဖက်ဖြင့် စတင်လိုက်ပါ။\n\nပြီးလျှင် သင့်ညာဘက်ခြေထောက်ကို မြှောက်ပြီး တင်ပါးကို တတ်နိုင်သမျှ ညှစ်လိုက်ပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ထပ်လုပ်ပါ။",
  'ex_desc_6': "တင်ပါးအောက် ဒူးလေးခုလုံးနှင့် သင့်ပခုံးအောက် လက်နှစ်ဖက်ကို စတင်လိုက်ပါ။\n\nထို့နောက် ဘယ်ခြေထောက်ကို မြှောက်ပြီး တင်ပါးကို တတ်နိုင်သမျှ ညှစ်လိုက်ပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ထပ်လုပ်ပါ။",
  'ex_desc_7': "ဒူးကွေးပြီး ခြေဖဝါးများကို ကြမ်းပြင်ပေါ်တွင် ပြန့်ကားလျက် ကျောပြင်ပေါ်တွင် လှဲအိပ်ပါ။\n\nသင့်လက်နှစ်ဖက်ကို သင့်နှစ်ဖက်တွင် ပြားပြားချထားပါ။\n\nပြီးနောက် သင့်တင်ပါးကို အပေါ်အောက် မြှောက်ပါ။",
  'ex_desc_8': "တင်ပါးအောက် ဒူးထောက်ကာ လေးခုစလုံးကို သင့်ပခုံးအောက်သို့ တိုက်ရိုက်စတင်လိုက်ပါ။\n\nထို့နောက် အသက်ရှုထုတ်ပြီး သင့်ဝမ်းဗိုက်ကို ပြုတ်ကျစေကာ ပခုံးများကို နောက်ပြန်ဆုတ်ကာ မျက်နှာကျက်ဆီသို့ ဦးခေါင်းတက်လာပါ။\n\nရှူသွင်းလိုက်သည်နှင့်၊ အနောက်သို့ ကွေးပြီး ခေါင်းငုံ့ထားလိုက်ပါ။\n\nလေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။\n\nဤလေ့ကျင့်ခန်း၏ ခြေလှမ်းတိုင်းဖြင့် ဖြည်းဖြည်းချင်းလုပ်ပါ။",
  'ex_desc_9': "ခြေဖဝါးများကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပါ။\n\nသင့်ဒူးကို ဆန့်ကျင်ဘက်တံတောင်ဆစ်သို့ ယူပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး အခြားတစ်ဖက်နှင့် ထပ်လုပ်ပါ။",
  'ex_desc_10': "ခုံတန်းရှည်တစ်ခုမှ ပေများစွာအကွာတွင် ရပ်ပါ။ သင့်ဘယ်ခြေကို နောက်ခုံတန်းပေါ်တွင် အနားယူပါ။\n\nသင့်နောက်ကျောဒူးဆစ်သည် ကြမ်းပြင်နှင့် ထိလုနီးပါးဖြစ်ပြီး သင့်ရှေ့ပေါင်သည် ကြမ်းပြင်နှင့်အပြိုင်ဖြစ်နေသည့်တိုင်အောင် သင့်ခန္ဓာကိုယ်ကို နှိမ့်ချလိုက်ပါ။\n\nထို့နောက် စတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ထပ်လုပ်ပါ။\n n\nရှေ့ခြေဖဝါးနှင့် ခုံတန်းကြားတွင် နေရာအလုံအလောက်ရှိသင့်ပြီး ရှေ့ဒူးသည် သင့်ခြေချောင်းများကို ကျော်မသွားစေရန်။ သင့်ခန္ဓာကိုယ်အပေါ်ပိုင်းကို ဖြောင့်ဖြောင့်ထားပါ။\n\n၎င်းသည် gluteus နှင့် တံကောက်ကြောဒဏ်ရာများအတွက် ကောင်းမွန်သောလေ့ကျင့်ခန်းဖြစ်သည်။",
  'ex_desc_11': "ခုံတန်းရှည်တစ်ခုမှ ပေများစွာအကွာတွင် ရပ်ပါ။ သင့်ညာဖက်ခြေဖဝါးကို သင့်နောက်က ခုံတန်းပေါ်တွင် အနားယူပါ။\n\nသင့်နောက်ကျောဒူးဆစ်သည် ကြမ်းပြင်နှင့်ထိလုနီးပါးဖြစ်ပြီး သင့်ရှေ့ပေါင်သည် ကြမ်းပြင်နှင့်အပြိုင်ဖြစ်နေသည့်တိုင်အောင် သင့်ခန္ဓာကိုယ်ကို နှိမ့်ချလိုက်ပါ။\n\nထို့နောက် စတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ထပ်လုပ်ပါ။\n n\nရှေ့ခြေဖဝါးနှင့် ခုံတန်းကြားတွင် နေရာအလုံအလောက်ရှိသင့်ပြီး ရှေ့ဒူးသည် သင့်ခြေချောင်းများကို ကျော်မသွားစေရန်။ သင့်ခန္ဓာကိုယ်အပေါ်ပိုင်းကို ဖြောင့်ဖြောင့်ထားပါ။\n\n၎င်းသည် gluteus နှင့် တံကောက်ကြောဒဏ်ရာများအတွက် ကောင်းမွန်သောလေ့ကျင့်ခန်းဖြစ်သည်။",
  'ex_desc_12': "ခြေထောက်တစ်ဖက်ကို ရှေ့သို့ မတ်တပ်ရပ်ပြီး ဒူးအနည်းငယ်ကွေးပါ။ သင့်တံတောင်ဆစ်များကို ကွေးပြီး မျက်နှာရှေ့တွင် လက်သီးများကို ဆုပ်ထားပါ။\n\nကြမ်းပြင်ကို မျက်နှာမူထားသော လက်ဖဝါးဖြင့် လက်တစ်ဖက်ကို ရှေ့သို့ဆန့်ပါ။ လက်ကိုပြန်ယူ၍ အခြားလက်တစ်ဖက်ဖြင့် ပြန်လုပ်ပါ။",
  'ex_desc_13': "တည့်တည့် လက်တံပျဉ်အနေအထားဖြင့် စတင်ပါ။ ထို့နောက် ခြေထောက်နှစ်ဖက်လုံးကို အပေါ်နှင့်\nအောက်သို့ မြှောက်ကာ နှိမ့်ချပါ။",
  'ex_desc_14': "ဗိုက်ပေါ်လှဲအိပ်ပြီး တံတောင်ဆစ်များကို ပခုံးအောက်တွင် လက်နှစ်ဖက်ဖြင့် ကွေးပါ။\n\nပြီးနောက် သင့်ရင်ဘတ်ကို မြေပြင်မှ တတ်နိုင်သမျှ တွန်းပါ။ စတင်သည့် အနေအထားသို့ ပြန်သွားပြီး ပြန်လုပ်ပါ။",
  'ex_desc_15': "ညာဘက်လက်ကို အပေါ်ကနေ မြှောက်ထားပြီး ဘယ်လက်ကို ခါးပေါ်တင်ထားပါ။ \nလက်ယာတံတောင်ဆစ်နှင့် ညာဒူးကို အချင်းချင်း ဆုံမိစေရန်။ ဆန့်ထုတ်ပြီး ပြန်လုပ်ပါ။",
  'ex_desc_16': "သင့်ခါးပေါ်ရှိ ဘယ်လက်ကို ဘယ်လက်ဖြင့် မြှောက်ထားပြီး ညာလက်ကို မတ်တပ်ရပ်ပါ။\n\nသင့်ဘယ်ဘက်တံတောင်ဆစ်နှင့် ဘယ်ဒူးကို အချင်းချင်းဆုံအောင်ထားပါ။ ဆန့်ထုတ်ပြီး ပြန်လုပ်ပါ။",
  'ex_desc_17': "90 ဒီဂရီ ထောင့်ချိုးတွင် ဒူးထောက်ကာ ကျောပြင်ပေါ်တွင် လှဲလျောင်းပြီး လက်နှစ်ဖက်ကို ခေါင်းနောက်သို့ ချထားပါ။\n\nခန္ဓာကိုယ်အပေါ်ပိုင်းနှင့် ပေါင်များကို မြှောက်ကာ ဆန့်ထုတ်ပါ။\n\nဤလေ့ကျင့်ခန်းကို ထပ်လုပ်ပါ။",
  'ex_desc_18': "သင့်တင်ပါးအောက်တွင် ဒူးထောက်ကာ လေးခုစလုံးကို သင့်ပခုံးအောက်ရှိ လက်များဖြင့် စတင်လိုက်ပါ။\n\nတံတောင်ဆစ်များကို ကွေးပြီး ဒိုက်ထိုးပါ။ စတင်သည့် အနေအထားသို့ ပြန်သွားပြီး ပြန်လုပ်ပါ။",
  'ex_desc_19': "သင့်တင်ပါးအောက်တွင် ဒူးထောက်ကာ လေးခုစလုံးကို သင့်ပခုံးအောက်မှ လက်နှစ်ဖက်ဖြင့် စတင်လိုက်ပါ။\n\nထို့နောက် သင့်ညာဘက်ခြေထောက်ကို 90 ဒီဂရီ ထောင့်သို့ ဆန့်တန်းလိုက်ပါ။",
  'ex_desc_20': "သင့်တင်ပါးအောက်တွင် ဒူးထောက်ကာ သင့်ပခုံးအောက်တွင် သင့်လက်များကို လေးခုလုံးတွင် စတင်လိုက်ပါ။\n\nထို့နောက် သင့်ဘယ်ဘက်ခြေထောက်ကို 90 ဒီဂရီ ထောင့်သို့ ဆန့်တန်းလိုက်ပါ။",
  'ex_desc_21': "ညာဖက်လက်မောင်းပေါ်တွင် ခေါင်းထောင်ပြီး စောင်းအိပ်ပါ။\n\nသင့်အပေါ်ပိုင်းခြေထောက်ကို မြှောက်ပြီး စတင်အနေအထားသို့ ပြန်သွားပါ။\n\nလေ့ကျင့်ခန်းလုပ်နေစဉ်အတွင်း သင့်ညာဖက်ခြေထောက်ကို ဖြောင့်ဖြောင့်တန်းတန်းမတ်မတ်ဖြစ်စေရန် သေချာပါစေ။\n\n၎င်းသည် gluteus အတွက်အလွန်ကောင်းသောလေ့ကျင့်ခန်း။",
  'ex_desc_22': "ညာဘက်လက်မောင်းပေါ်တွင် ခေါင်းကို မတ်မတ်ထားပြီး စောင်းအိပ်ပါ။\n\nသင့်အပေါ်ပိုင်းခြေထောက်ကို မြှောက်ပြီး စတင်အနေအထားသို့ ပြန်သွားပါ။\n\nလေ့ကျင့်ခန်းလုပ်နေစဉ်အတွင်း သင့်ဘယ်ဘက်ခြေထောက်ကို ဖြောင့်ဖြောင့်တန်းတန်းမတ်မတ်ဖြစ်စေပါ။\n\n၎င်းသည် gluteus အတွက်အလွန်ကောင်းသောလေ့ကျင့်ခန်း။",
