  'ex_desc_40': "ခြေထောက်များကို ဆန့်တန်းကာ တံတောင်ဆစ်များကို ပခုံးအောက်သို့ တိုက်ရိုက်တင်ကာ ကျောပြင်ပေါ်တွင် လှဲအိပ်ပါ။\n\nညာဘက်လက်ကို ဘယ်ဘက်သို့ ဆန့်တန်းထားစဉ်တွင် ဘယ်ဘက်ခြေထောက်ကို ၄၅ ဒီဂရီ ထောင့်ချိုးသို့ ဆန့်တန်းလိုက်ပါ။\n\nထို့နောက် အစသို့ ဖြည်းဖြည်းချင်း ပြန်သွားပါ။ အနေအထား။\n\nအကြိမ်များစွာ ပြန်လုပ်ပါ၊ ထို့နောက် အခြားတစ်ဖက်သို့ ပြောင်းပါ။",
  'ex_desc_41': "ခြေချောင်းများနှင့် လက်ဖျံများကို မြေပြင်ပေါ်တွင် လှဲလျောင်းပါ။\n\nသင့်ခန္ဓာကိုယ်ကို ဖြောင့်ဖြောင့်ထားပြီး ဤအနေအထားကို တတ်နိုင်သမျှ ထိန်းထားပါ။\n\nဤလေ့ကျင့်ခန်းသည် ဝမ်းဗိုက်၊ နောက်ကျောနှင့် ပခုံးတို့ကို အားကောင်းစေသည်။",
  'ex_desc_42': "သင့်လက်နှစ်ဖက်ကို ဘေးနှစ်ဖက်တွင်ထားပြီး \nပခုံးများကို အနည်းငယ်မြှောက်၍ ကျောပြင်ပေါ်တွင် လှဲလျောင်းပါ။\n\nခြေထောက်များကို ကြမ်းပြင်မှ မြှောက်ကာ ဒူးကိုကွေးပြီး \nတို့ကို သင့်ရင်ဘတ်ဆီသို့ ဆွဲတင်လိုက်ပါ။\n\nသင့်ခြေထောက်များကို ရှေ့သို့ ကန်ထုတ်ပြီး ထပ်ခါထပ်ခါ ပြုလုပ်ပါ။",
  'ex_desc_43': "ကြမ်းပြင်ပေါ်တွင် မတ်တပ်ရပ်ပြီး ခြေဖနောင့်ကို ထိရန် ခြေဖနောင့်ကို ဆောင့်ကန်ရင်း နေရာတွင် ပြေးပါ။\n\nတတ်နိုင်သမျှ မြန်မြန်ကြိုးစားပါ။\n\nဂလူတက်နှင့် ကြိုးများ အတွက် အလွန်ကောင်းမွန်သော လေ့ကျင့်ခန်းဖြစ်သည်။",
  'ex_desc_44': "ဘယ်ခြေကို ညာခြေနောက်မှာထားပြီး ဘယ်ဘက်စောင်းအိပ်ပါ။\n\nညာဘက်လက်ကို ဦးခေါင်းနောက်မှာထားပြီး ဘယ်ဘက်လက်ကို ညာဘက်ခြမ်းက ကြွက်သားတွေရဲ့ ညာဘက်ခြမ်းမှာထားပါ။\n\nဘယ်ဘက်ပခုံးကို ကြမ်းပြင်ပေါ်ကနေ မြှောက်လိုက်ပါ။\n\nလေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_45': "ဘယ်ခြေနောက်မှာ ညာခြေကို ညာခြေနဲ့ စောင်းအိပ်ပါ။\n\nဘယ်ဘက်လက်ကို ခေါင်းနောက်မှာထားပြီး ညာဘက်လက်ကို ဘယ်ဘက်ခြမ်းက လေးထောင့်ပုံစံကြွက်သားတွေပေါ်မှာထားပါ။\n\nညာဘက်ပခုံးကို ကြမ်းပြင်ပေါ်ကနေ မြှောက်လိုက်ပါ။\n\nလေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_46': "ခြေထောက်များကို ကွေးပြီး လက်နှစ်ဖက်ကို ဘေးချင်းကပ်လျက် မြေပြင်ပေါ်တွင် လှဲလျောင်းပါ။\n\nသင့်ခန္ဓာကိုယ်အပေါ်ပိုင်းကို ကြမ်းပြင်မှ အနည်းငယ်ကြွပြီး သင့်လက်များကို ဒေါက်ဖိနပ်များဆီသို့ တလှည့်စီရောက်ရှိအောင် ပြုလုပ်ပါ။",
  'ex_desc_47': "ဒူးကွေးကာ ကြမ်းပြင်ပေါ်တွင် ထိုင်ကာ ခြေဖဝါးကို အနည်းငယ် မြှောက်ကာ နောက်သို့ ကျောခိုင်းပါ။\n\nသင်၏ခြေထောက်များကို မြှောက်ပြီး ဒူးထောက်ကာ လက်ခုပ်တီးကာ ကြမ်းပြင်ပေါ်တွင် ထိုင်ပါ။",
  'ex_desc_48': "လက်နှစ်ဖက်ကို ဆန့်တန်းပြီး ဗိုက်ပေါ်လှဲအိပ်ပါ\nခေါင်းပေါ်တည့်တည့်။ ထို့နောက် လက်နှစ်ဖက်လုံးကို မြှောက်ပြီး\nကြမ်းပြင်ပေါ်မှ ခြေထောက်ကိုမြှောက်ပါ။\n\nဤအနေအထားကို နှစ်စက္ကန့်ကြာ ထိန်းထားပါ။ \nစတင်သည့် အနေအထားသို့ ပြန်သွားပြီး ထပ်လုပ်ပါ။",
  'ex_desc_49': "ခြေထောက်များကို ဆန့်တန်းထားပြီး ကျောပြင်ပေါ်တွင် လှဲအိပ်ပါ\nတင်ပါးအောက်ရှိ လက်များကို\n\nပေါင်များ\nကြမ်းပြင်နှင့် ထောင့်မှန်သည်အထိ ဒူးထောက်လိုက်ပါ။ သင်၏\nခြေထောက်များကို ဖြောင့်တန်းပြီး တင်ပါးကို ကြမ်းပြင်ပေါ်မှ မြှောက်ပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး\nလေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။\n",
  'ex_desc_50': "တင်ပါးအောက် ဒူးထောက်ကာ သင့်ပခုံးအောက် လက်နှစ်ဖက်ဖြင့် စတင်လိုက်ပါ။\n\nထို့နောက် သင့်ညာဘက်ခြေထောက်နှင့် ဘယ်ဘက်လက်ကို တစ်ချိန်တည်း ဆန့်တန်းလိုက်ပါ။\n\nငါးစက္ကန့်လောက် ဖိထားပြီး နောက်တစ်ဖက်သို့ ပြန်သွားပြီး နောက်တစ်ဖက်နှင့် ထပ်လုပ်ပါ။",
  'ex_desc_51': "သင့်လက်ဖျံနှင့် ဘယ်ဘက်စောင်းအိပ်ပါ\nခန္ဓာကိုယ်အပေါ်ပိုင်းနှင့် ညာဖက်လက်ကို ထောက်ထားပြီး သင့်ရှေ့တွင် မြေကြီးပေါ်တွင် လှဲပါ။\n\nခြေထောက်နှစ်ချောင်းကို တညီတည်းထားပါ။ ခြေထောက်များကို ပေါ့ပေါ့ပါးပါး မြှောက်ပြီး\nတစ်စက္ကန့်လောက် ဖိထားပါ၊ ထို့နောက်\nစတင်သည့် အနေအထားသို့ ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_52': "သင့်လက်ဖျံနှင့် ညာဘက်စောင်းအိပ်ပါ\nခန္ဓာကိုယ်အပေါ်ပိုင်းနှင့် ဘယ်ဘက်\nလက်ကို သင့်ရှေ့တွင် မြေကြီးပေါ်တွင် ထောက်ထားပါ။\n\nခြေထောက်နှစ်ဖက်လုံးကို အတူတူထားပါ။ ခြေထောက်များကို ပေါ့ပေါ့ပါးပါး မြှောက်ပြီး\nတစ်စက္ကန့်လောက် ဖိထားပါ၊ ထို့နောက်\nစတင်သည့် အနေအထားသို့ ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။\n",
  'ex_desc_53': "ဒူးကွေးပြီး ကြမ်းပြင်ပေါ်တွင် ထိုင်ကာ ခြေဖဝါးကို အနည်းငယ် မြှောက်ကာ နောက်သို့ ကျောခိုင်းပါ။\n\nပြီးနောက် လက်နှစ်ဖက်ကို ကိုင်ထားပြီး ဘေးတစ်ဖက်သို့ လှည့်ပါ။",
  'ex_desc_54': "ပုံမှန် တွန်းတင်သည့် အနေအထားတွင် စတင်သော်လည်း ကုလားထိုင် သို့မဟုတ် ခုံတန်းရှည်ပေါ်တွင် သင့်လက်များကို မြှင့်တင်လိုက်ပါ။\n\nထို့နောက် သင့်လက်မောင်းအားသုံးပြီး သင့်ခန္ဓာကိုယ်ကို အပေါ်သို့ တွန်းချပါ။ ခန္ဓာကိုယ်ကို ဖြောင့်ဖြောင့်ထားဖို့ မမေ့ပါနဲ့။",
  'ex_desc_55': "မတ်တတ်ရပ်ပါ။ ပြီးရင် ဘယ်ခြေထောက်နဲ့ နောက်ပြန်ဆုတ်ပြီး ခန္ဓာကိုယ်ကို လျှော့ပါ။ သင်တက်လာသောအခါတွင် သင့်ဘယ်ဘက်ခြေထောက်ကို အထက်သို့ ကန်ထုတ်ပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_56': "မတ်တတ်ရပ်ပါ။ ပြီးရင် ညာဘက်ခြေထောက်နဲ့ နောက်ပြန်ဆုတ်ပြီး ခန္ဓာကိုယ်ကို လျှော့ပါ။ သင်ထလာသောအခါတွင် သင့်ညာဘက်ခြေထောက်ကို အထက်သို့ ကန်ထုတ်ပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_57': "စတင်အနေအထားအတွက် ကုလားထိုင်ပေါ်တွင် ထိုင်ပါ။ ထို့နောက် \nသင့်၏\nကိုယ်ခန္ဓာကို အပေါ်နှင့်အောက်သို့ တက်စေရန် လက်နှစ်ဖက်ဖြင့် ကုလားထိုင်မှ\n\nသင်၏ တင်ပါးကို ကုလားထိုင်ပေါ်မှ ရွှေ့ပါ။\n\nသင်၏\nခန္ဓာကိုယ်ကို အပေါ်နှင့် အောက်သို့ ကွေးသွားစေရန် သင့်လက်များကို ဖြည်းညှင်းစွာ ကွေးပြီး ဆန့်တန်းပါ။ ၎င်းသည်\ntriceps အတွက် ကောင်းမွန်သောလေ့ကျင့်ခန်းတစ်ခုဖြစ်သည်။",
  'ex_desc_58': "သင့်ခြေထောက်များကို ပခုံးထက်အနည်းငယ်ကျယ်သော\nအကျယ်အဝန်းဖြင့် မတ်တပ်ရပ်ပါ၊ တံတောင်ဆစ်ကွေးကာ၊ လက်ဖဝါးတစ်ဖက်စီကို မျက်နှာမူကာ မျက်နှာကျက်ဆီသို့ ညွှန်ပြပါ။\n\nပေါင်နှင့်\nကြမ်းပြင်နှင့် အပြိုင်ဖြစ်နေသည့်တိုင်အောင် သင့်ခန္ဓာကိုယ်ကို နှိမ့်ချလိုက်ပါ။ သင်တက်လာသောအခါ၊ သင့်ခန္ဓာကိုယ်ကို\nဘယ်ဘက်သို့လှည့်ပါ၊ ညာဘက်ခြေထောက်ကို ဖြောင့်တန်းပါ၊ ညာဖက်\nခြေဖနောင့်ကို ဆန့်ပြီး ညာဘက်လက်မောင်းကို\nဘယ်ဘက်သို့ရောက်ရှိပါ။\n\nစတင်အနေအထားသို့ ပြန်သွားပြီး \nအခြားနှင့် ထပ်လုပ်ပါ။ ဖွတ်။",
