  'ex_desc_76': "သင့်ခြေထောက်များကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပါ၊ ထို့နောက် သင့်လက်များကို မြေပြင်ပေါ်တင်ကာ ခြေဖဝါးကို နောက်သို့ပြန်ကန်လိုက်ပါ။\n\nဒိုက်ထိုးခြင်းကို အမြန်လုပ်ပြီး အပေါ်သို့ ခုန်ပါ။",
  'ex_desc_77': "သင်၏ခြေဖဝါးကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပြီး သင့်တင်ပါးပေါ်တွင် လက်နှစ်ဖက်ကို မတ်တပ်ရပ်ပါ။\n\nညာဘက်ခြေထောက်နှင့် ဘယ်ဘက်ပေါင်ကို ကြမ်းပြင်နှင့် အပြိုင်ဖြစ်နေသည့်တိုင်အောင် သင့်ခန္ဓာကိုယ်ကို ညာဖက်ခြေထောက်ဖြင့် နောက်ပြန်ဆုတ်ပါ။\n\nနောက်သို့ပြန်၍ အခြားတစ်ဖက်နှင့် ထပ်လုပ်ပါ။",
  'ex_desc_78': "ပျဉ်ခင်းအနေအထားတွင် စတင်ပါ။ သင့်ခန္ဓာကိုယ်\nနောက်ပြန်လှည့်ပါ။",
  'ex_desc_79': "ကြမ်းပြင်ပေါ်တွင် မတ်တပ်ရပ်ပြီး လက်နှစ်ဖက်ကို ရှေ့သို့တင်ကာ ဘေးတစ်ဖက်သို့ ခုန်ချပါ။",
  'ex_desc_80': "ခြေဖဝါးများကို တွဲလျက် လက်များကို\nခေါင်းအထက် မြှောက်ပါ။\n\nခုန်တက်ကာ ခြေဖဝါးကို ဖြန့်ကာ၊\nလက်များကို လျှော့ကာ ထိုင်ချပါ။\n\nစတင် အနေအထားသို့ ပြန်ခုန်ပြီး \nနောက်ထပ် ထပ်လုပ်ပါ။",
  'ex_desc_81': "သင့်လက်များကို သင့်ပခုံးအောက်၊ ဘယ်ခြေထောက်ကို ကွေးပြီး သင့်ဘယ်ဘက်လက်မောင်း၏အပြင်ဘက်နှင့် သင့်ညာဘက်ခြေထောက်ကို သင့်နောက်သို့ဆန့်ထုတ်ခြင်းဖြင့် စတင်ပါ။ ပြီးရင် ခုန်ပြီး ခြေထောက်တွေကို လေထဲပြောင်းလိုက်ပါ။",
  'ex_desc_82': "သင့်လက်နှစ်ဖက်ကို ဘေးနှစ်ဖက်တွင်ချထားပြီး လက်တစ်ဖက်စီတွင် ကြိုးတစ်ချောင်းကို ကိုင်ထားဟန်ဆောင်ပါ။\n\nကြိုးတစ်ချောင်းကို လှည့်နေသကဲ့သို့ သင့်ခြေဖဝါးပေါ်ကို ခုန်ပြီး လက်ကောက်ဝတ်များကို လှည့်ကာ တစ်ချိန်တည်းတွင် ခုန်ပါ။",
  'ex_desc_83': "ထိုင်ထ အနေအထားတွင် စတင်ပါ၊ ထို့နောက် ခွန်အားအတွက် သင့်ဝမ်းဗိုက်ကြွက်သားများကို အသုံးပြု၍ ခုန်တက်ပါ။\n\nဤလေ့ကျင့်ခန်းသည် သင့်ဝမ်းဗိုက်ကို အကျိုးပြုပါသည်။",
  'ex_desc_84': "လက်နှစ်ဖက်ဖြင့်\nကိုယ်ကို ထောက်လျက် မြေပြင်ပေါ်တွင် မှောက်လျက်အိပ်ပါ။ ရှေ့သို့ခုန်ပါ၊ ဒူးထောက်၍\nသင့်ရင်ဘတ်ဆီသို့ ဆောင်သွားကာ စတင်\nအနေအထားသို့ ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_85': "ဖြောင့်တန်းသော လက်မောင်းပျဉ်အနေအထားဖြင့် စတင်ပါ။\nပြီးနောက် ညာဘက်လက်မောင်းကို ကွေးပြီး လက်ဖျံ\nပခုံးအောက်တွင် တံတောင်ဆစ်ဖြင့် မြေပြင်ကို ချထားကာ၊ ထို့နောက် ဘယ်ဘက်လက်မောင်းကို ကွေးပြီး\nရိုးရာပျဉ်ထောင်အနေအထားသို့ ဆင်းပါ။\n\nထို့နောက် နောက်ပြန်လှည့်ပါ။ ပြီးလျှင် စတင်\nအနေအထားသို့ ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။\n\nလေ့ကျင့်ခန်းလုပ်နေစဉ်အတွင်း သင့်ခန္ဓာကိုယ်ကို ဖြောင့်တန်းနေအောင်ထားပါ။\nသင်ဆင်းလာသည့်အခါ အသက်ရှူသွင်းပြီး\nတက်လာသည့်အခါ အသက်ရှူသွင်းပါ။\n\nquadriceps၊ triceps\nနှင့် ဝမ်းဗိုက်ကြွက်သားများအတွက် အလွန်ကောင်းမွန်သော လေ့ကျင့်ခန်းဖြစ်သည်။",
  'ex_desc_86': "ဘယ်ခြေထောက်ကို မြေကြီးပေါ်တွင် မတ်တပ်ရပ်ပြီး ညာခြေထောက်ကို တည့်တည့်မတ်မတ်ရပ်ပြီး ညာဖက်သို့ မြှောက်လိုက်ပါ။\n \nအနည်းငယ်ခုန်ပြီး ဘယ်ခြေထောက်ကို ဘယ်ဘက်သို့ လွှဲလိုက်ပါ။ ခြေထောက်ကို အမြန်ပြောင်းပြီး ထပ်လုပ်ပါ။",
  'ex_desc_87': "ပုံမှန် တွန်းတင်သည့် အနေအထားတွင် စတင်ပါ၊ ထို့နောက် သင့်\nknees များကို ကြမ်းပြင်နှင့် ထိပြီး သင့်ခြေဖဝါးကို\nကြမ်းပြင်မှ အပေါ်သို့ မြှောက်လိုက်ပါ။\n\nထို့နောက် သင့်ခန္ဓာကိုယ်ကို အပေါ်နှင့်အောက် တွန်းလိုက်ပါ။",
  'ex_desc_88': "ခြေလှမ်းတစ်လှမ်းချင်းစီဖြင့် ဒူးများကို တတ်နိုင်သမျှ မြင့်အောင်ဆွဲကာ နေရာတွင် ပြေးပါ။\n \nဤလေ့ကျင့်ခန်းလုပ်နေစဉ် သင့်အပေါ်ပိုင်းကို မတ်မတ်ထားပါ။",
  'ex_desc_89': "သင့်ခြေထောက်များကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပါ။\n\nသင်၏လက်များကို မြေပြင်ပေါ်တင်ပြီး ခြေဖဝါးကို နောက်ပြန်ကန်ထုတ်ပြီးနောက် ခြေဖဝါးကို နောက်ပြန်ဆွဲကာ ထခုန်လိုက်ပါ။\n\nလေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_90': "ခြေဖဝါးနှစ်ဖက်နှင့် လက်နှစ်ဖက်ကို တွဲလျက်ရပ်ပါ။\n\nသင်၏ခြေထောက်များကို ဖြဲပြီး လက်နှစ်ဖက်ကို စာလုံးပုံစံ \"X\" ဟူသော စာလုံးပုံစံဖြင့် ခေါင်းပေါ်တက်ပါ။\n\nနောက်သို့ခုန်ပါ၊ သင်၏လက်များကို မြေကြီးပေါ်တင်ပါ၊ သင့်ခြေထောက်များကို နောက်ပြန်ကန်ထုတ်ပြီး ၎င်းတို့ကို ခွဲထုတ်လိုက်ပါ။\n\nစတင်အနေအထားသို့ ပြန်လာပြီး ပြန်လုပ်ပါ။",
  'ex_desc_91': "ထိုင်ခုံမှာထိုင်ပါ။ ခြေဖဝါးကို ကြမ်းပြင်ပေါ်မှ မြှောက်ပြီး နောက်သို့ အနည်းငယ် လှန်ပါ။ ဘယ်ဘက်ဒူးကို မြှောက်ပြီး ညာဘက်တံတောင်ဆစ်ဆီ ရောက်အောင်ထားပါ။ ဘက်ကိုပြောင်းပြီး ပြန်လုပ်ပါ။",
  'ex_desc_92': "ကုလားထိုင်ပေါ်တွင်ထိုင်ပြီး\nကုလားထိုင်အစွန်းကို ကိုင်ထားရန် ညာလက်ကိုသုံးပါ။\n\nသင့်ခေါင်းကို ဘယ်ဘက်အရှေ့ဘက်သို့ လှည့်ပြီး\nဘယ်လက်ကို \nခေါင်းညာဘက်ခြမ်းတွင်ထားပါ။\n\nထို့နောက် ခေါင်းကို ဘယ်ဘက်\nအရှေ့ဘက်သို့ ညင်သာစွာ ဆွဲယူပါ။ စက္ကန့်အနည်းငယ်ကြာအောင် ဖိထားပါ။",
  'ex_desc_93': "ကုလားထိုင်ပေါ်တွင်ထိုင်ပြီး\nကုလားထိုင်အစွန်းကို ကိုင်ထားရန် ဘယ်လက်ကိုသုံးပါ။\n\nသင့်ခေါင်းကို ညာဘက်အရှေ့ဘက်သို့ လှည့်ပြီး\nညာဘက်လက်ကို\nခေါင်း၏ဘယ်ဘက်ခြမ်းတွင်ထားပါ။\n\nထို့နောက် သင့်ခေါင်းကို \nညာဘက်အရှေ့ဘက်သို့ ညင်သာစွာဆွဲပါ။ စက္ကန့်အနည်းငယ်ကြာအောင် ဖိထားပါ။",
  'ex_desc_94': "ခြေဖဝါးများကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပါ။\nဟန်ချက်ညီစေရန် လက်ကို နံရံပေါ်တင်ထားပါ။\n\nခြေချောင်းများကို ညွှန်ပြရန် ခြေမျက်စိများကို လှည့်ကာ\nအပြင်ဘက်သို့ ခြေဖနောင့်ကို အပေါ်သို့ မြှောက်လိုက်ပါ။",
  'ex_desc_95': "သင်၏ခြေဖဝါးကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပြီး\nသင်၏လက်များကို နားရွက်နောက်သို့ မတ်တပ်ရပ်ပါ။\n\nညာဘက်ဒူးကို မြှောက်ပြီး ညာဒူးကိုထိရန် ဘယ်ဘက်တံတောင်ကို အသုံးပြုပါ။ \nဘေးများကို ပြောင်းပြီး ထပ်လုပ်ပါ။",
  'ex_desc_96': "ကုလားထိုင်ပေါ်တွင် ကျောတည့်တည့်ဖြင့် ထိုင်ပါ။ ဘယ်ဘက်ဒူးကို အပေါ်သို့ ဖြောင့်တန်းစွာ မြှောက်လိုက်ပြီး အောက်သို့ ဖြည်းညှင်းစွာ နှိမ့်လိုက်ပါ။",
  'ex_desc_97': "ကုလားထိုင်ပေါ်တွင် ကျောတည့်တည့်ဖြင့် ထိုင်ပါ။ ညာဖက်ဒူးကို အပေါ်သို့ ဖြည်းဖြည်းချင်း မြှောက်ကာ ဖြည်းဖြည်းချင်း နိမ့်ချပါ။",
  'ex_desc_98': "နံရံနှင့် နောက်ကျောကို စတင်ကာ ဒူးများ 90 ဒီဂရီ ထောင့်ရောက်သည်အထိ အောက်သို့လျှောချပါ။\n\nနောက်ကျောကို လက်နှစ်ဖက်နှင့် လက်နှစ်ဖက်ကို ခြေထောက်များမှ ခွာ၍ နံရံနှင့် ခွာထားပါ။\n\nအနေအထားကို ထိန်းထားပါ။\n\nလေ့ကျင့်ခန်းသည် quadriceps ကြွက်သားများကို သန်မာစေပါသည်။",
  'ex_desc_99': "ခြေဖဝါးကို\nကြမ်းပြင်ပေါ်တွင် ပြန့်ကားနေသော ကုလားထိုင်တွင် တည့်တည့်ထိုင်ပါ။\n\nဘယ်ဘက်လက်ဖြင့် ကုလားထိုင်၏ ညာဘက်အစွန်းကို ကိုင်ပါ။ ထို့နောက် သင့်ညာဖက်လက်မောင်းကို ခေါင်းပေါ်ရောက်ရှိပြီး\nသင့်ခန္ဓာကိုယ်ကို ဘယ်ဘက်သို့ ကွေးလိုက်ပါ။\n\nဤအနေအထားကို ထိန်းထားပါ။",
  'ex_desc_100': "မတ်တပ်ရပ် သို့မဟုတ် ထိုင်ပါ။\nသင့်ပခုံးများကို နားရွက်ဆီသို့ လှိမ့်ကာ\nနောက်သို့ လှည့်ပြီး ညှစ်ပါ၊ ထို့နောက် \nအောက်သို့ လှိမ့်ပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
