  'ex_desc_106': "ဘယ်လက်ကို နောက်ကျောပေါ်တင်ပါ၊ ဘယ်ဘက်တံတောင်ဆစ်ကို ဖမ်းပြီး ညင်သာစွာ ဆွဲယူရန် ညာလက်ကို အသုံးပြုပါ။\n\nဤအနေအထားကို စက္ကန့်ပိုင်းလောက် ထိန်းထားပါ။",
  'ex_desc_107': "ခြေဖဝါးကို\nကြမ်းပြင်ပေါ်တွင် ကုလားထိုင်တွင် တည့်မတ်စွာထိုင်ပါ။\n\nညာဘက်မှ ကုလားထိုင်၏ဘယ်ဘက်အစွန်းကို\nလက်ဖြင့်ဆွဲပါ။ ထို့နောက် သင့်ဘယ်ဘက်လက်မောင်းကို ဦးခေါင်းပေါ်သို့ရောက်ရှိပြီး\nသင့်ခန္ဓာကိုယ်ကို ညာဘက်သို့ကွေးလိုက်ပါ။\n\nဤအနေအထားကို ထိန်းထားပါ။",
  'ex_desc_108': "ခြေဖဝါးများကို ပခုံးအကျယ်အကွာအဝေးဖြင့် မတ်တပ်ရပ်ပါ။\n\nဘယ်လက်ကို ခေါင်းနောက်မှာထားပြီး ညာလက်ကို သင့်ဘေးမှာထားပါ။ သင့်ခန္ဓာကိုယ်ကို\nညာဘက်သို့ကွေးပြီး ညာလက်ကို\nကြမ်းပြင်ဆီသို့ လျှော့ပါ။\n\nတစ်စက္ကန့်လောက်ရပ်ပြီး\nသို့ပြန်သွားပါ။",
