  'ex_desc_123': "ဦးခေါင်းကို ညာဘက်ခြမ်းတွင် လှဲလျောင်းပြီး\nညာဘက်လက်မောင်းနှင့် ဒူးဆစ်များကို ကွေးထားပါ။\n\nသင်၏\nခြေဖနောင့်များကို ထိနေချိန်တွင် ဘယ်ဘက်ဒူးကို အပေါ်သို့ ကြွပါ၊ ထို့နောက် စတင်\nအနေအထားသို့ ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_124': "ညာဖက်တွင် ခေါင်းကို မတ်မတ်ထားပြီး ညာဖက်တွင် လှဲလျောင်းပါ။\n\nပြီးနောက် ဘယ်ခြေကို ကြမ်းပြင်ပေါ်တွင် ရှေ့သို့ချထားပါ။\n\nညာဘက်ခြေထောက်ကို အပေါ်နှင့်အောက် မြှောက်ပါ။",
