  'ex_desc_128': "ကြမ်းပြင်ပေါ်မှာထိုင်ပြီး နောက်ပြန်လှဲပြီး ခြေထောက်တွေကို ကြမ်းပြင်ပေါ်ကနေ မြှောက်လိုက်ပါ။ ဟန်ချက်ညီသော အနေအထားကို ရှာဖွေပြီးနောက်၊ သင့်အပေါ်ပိုင်းကို မြှောက်ပြီး ဒူးကို ရင်ဘတ်ဆီသို့ ပို့ဆောင်ပါ။ ထို့နောက် ဆန့်ထုတ်ပြီး ထပ်လုပ်ပါ။\n\nသင့်ခန္ဓာကိုယ်ကို မြှောက်ပြီး ဆန့်လိုက်သည့်အခါ ရှူသွင်းပါ။\n\nဝမ်းဗိုက်အောက်ပိုင်းကြွက်သားအတွက် အလွန်ကောင်းမွန်သော လေ့ကျင့်ခန်းဖြစ်သည်။",
