  'ex_desc_130': "ခြေဖဝါးကို ကြမ်းပြင်ပေါ်တွင် ပက်လက်လှန်ပြီး လှဲလျောင်းပါ။ ညာဘက်ခြေကျင်းဝတ်ကို ဘယ်ဒူးပေါ်တင်ပါ၊ ဘယ်လက်ကို နားရွက်နောက်မှာထားပြီး ညာလက်ကို ကြမ်းပြင်ပေါ် ဆန့်တန်းထားပါ။\n\nသင့်ပုခုံးတွေကို ကြမ်းပြင်ပေါ်ကနေ မြှောက်ထားပြီး ညာဒူးနဲ့ ညာဘက်လက်မောင်းကို ဘယ်ဘက်တံတောင်ဆစ်ကို ယူဆောင်ကာ ညာလက်မောင်းနဲ့ နီးကပ်စွာထားပါ။ ပြီးရင် ဖြည်းဖြည်းချင်း ပြန်သွားပါ။ လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
