  'ex_desc_135': "ဒူးကွေးကာ ခြေဖဝါးကို မြေပြင်ပေါ်တွင် ပြန့်ကားပြီး တင်ပါးအောက် လက်နှစ်ဖက်ဖြင့် ကျောပြင်ပေါ်တွင် လှဲလျောင်းပါ။\n\nသင်၏ခြေထောက်များကို စားပွဲပေါ်တင်ထားသည့် အနေအထားသို့ မြှောက်ပါ။ မင်းရဲ့ဘယ်ဘက်ခြေကို မြေကြီးပေါ်ချလိုက်ပါ။ သင်၏ခြေချောင်းများနှင့်မြေပြင်ကိုထိပုတ်ပါ; ထို့နောက် ခြေထောက်ကို ပြန်မြှင့်ပါ။ နှစ်ဖက်ပြောင်းပြီး လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။",
  'ex_desc_136': "သင်၏လက်များကို အပြည့်ဆန့်ကာ ကြမ်းပြင်ပေါ်တွင် မှောက်လျက်အိပ်ပြီး လက်မကို အပေါ်သို့ ညွှန်ပြပါ၊ သင့်ခန္ဓာကိုယ်သည် \"Y\" အက္ခရာပုံသဏ္ဍာန်ဖြစ်သင့်သည်\n\nလက်များကို မြေပြင်မှ မြှောက်ပြီး ခေတ္တရပ်ပါ။ ထိပ်မှာ 2 စက္ကန့်ထားပါ။ စတင်အနေအထားကို ဖြည်းဖြည်းချင်းပြန်သွားပြီး လေ့ကျင့်ခန်းကို ပြန်လုပ်ပါ။ \n",
  'ex_desc_137': "ခြေဖဝါးနှစ်ဖက်နှင့် ကြမ်းပြင်ပေါ်တွင် ထိုင်ပြီး\nခြေချောင်းများကို ဆုပ်ကိုင်ပါ။\n\nသင့်ဒူးနှစ်ဖက်ကို ဖွင့်ပြီး \nk ဒူးများကို အောက်သို့ ဖိပါ။ ဒီရာထူးကို ကိုင်ထားပါ။",
