  'ex_desc_159': "နံရံတစ်ခုရှေ့ အကွာအဝေးတွင် ခြေတစ်လှမ်း လှမ်းရပ်ပါ။\n\nသင်၏ ညာခြေနှင့် ရှေ့သို့ ခြေတစ်လှမ်း လှမ်းပြီး နံရံကို လက်ဖြင့် တွန်းပါ။\n\nကျေးဇူးပြု၍ သင့်ဘယ်ဘက်ခြေထောက်ကို အပြည့်အဝ ဆန့်ထားပြီး သင့်ဘယ်ဘက် ခြေသလုံးကြွက်သား ဆန့်ကြောင်းကို ခံစားရနိုင်ပါသည်။\n\nဤအနေအထားကို စက္ကန့်အနည်းငယ်ကြာအောင် ထိန်းထားပါ။",
