  'ex_desc_161': "ခြေထောက်နှစ်ဖက်ဖြင့် ကြမ်းပြင်ပေါ်တွင် လှဲလျောင်းပါ။\n\nသင့်ဒူးနှစ်ဖက်ကို ဖွင့်ပါ။\n\nဤအနေအထားကို ထိန်းထားပါ။",
  'ex_desc_162': "ခြေထောက်များကို တည့်တည့်မတ်မတ်ထားပြီး ကျောပြင်ပေါ်တွင် လှဲလျောင်းပြီး လက်နှစ်ဖက်ကို ဘေးနှစ်ဖက်တွင် ဆန့်တန်းထားပါ။\n\nသင့်ဒူးကို မြှောက်ပြီး ညာဘက်သို့ ခြေထောက်များကို လိမ်ပါ။\n\nဤလေ့ကျင့်ခန်းကို ထိန်းထားပါ။",
  'ex_desc_163': "ခြေထောက်များကို တည့်တည့်မတ်မတ်ထားပြီး ကျောပြင်ပေါ်တွင် လှဲလျောင်းပြီး လက်နှစ်ဖက်ကို ဘေးနှစ်ဖက်တွင် ဆန့်တန်းထားပါ။\n\nဒူးများကို မြှောက်ပြီး ခြေထောက်များကို ဘယ်ဘက်သို့ လိမ်ပါ။\n\nဤလေ့ကျင့်ခန်းကို ထိန်းထားပါ။",
