  'ex_desc_168': "ခြေထောက်များကို ဆန့်ထုတ်ကာ ကျောပြင်ပေါ်တွင် လှဲလျောင်းပါ။\nညာဘက်ခြေထောက်ကို မြှောက်ပြီး ဘယ်ဘက်လက်ကို အသုံးပြုပါ\nညာဘက်ဒူးကို ဘယ်ဘက်သို့ ဆွဲယူပါ၊ သို့သော်\nအခြားလက်တစ်ဖက်ကို\nကြမ်းပြင်တွင် ဖြန့်ထားပါ။\n\nဤအရာကို ထိန်းထားပါ။ စက္ကန့်အနည်းငယ်ကြာအောင်အနေအထား။",
