  ///  Plan Introduction Strings
  'plan_introduction_1': "3-10 မိနစ် ထိရောက်တဲ့ လေ့ကျင့်ခန်းက အဆီကျစေပြီး ကြံ့ခိုင်နေအောင် ကူညီပေးပါတယ်။ သင်၏ကိုယ်အလေးချိန်ပန်းတိုင်ကို အမြန်အောင်မြင်ပါစေ။",
  'plan_introduction_2': "၅-၁၅ မိနစ်ခန့် ရိုးရှင်းသော လေ့ကျင့်ခန်းများ သင့်တင်ပါးကို တင်းတင်းကြပ်ကြပ် မြှောက်ထားပါ။ အချိန်တိုအတွင်း ကောင်းမွန်သော တင်ပါးကို ရယူလိုက်ပါ။",
  'plan_introduction_3': "အိမ်မှာနေရင်း တိုတိုနဲ့ ထိရောက်တဲ့ လေ့ကျင့်ခန်းတွေနဲ့ ဗိုက်အဆီတွေကို လျှော့ချပြီး ဗိုက်ကို ပြားစေတယ်။ ရက်သတ္တပတ်အနည်းငယ်အတွင်း ဗိုက်ချပ်လာပါလိမ့်မယ်။",
  'plan_introduction_4': "ဤလေ့ကျင့်ခန်းများသည် ကြွက်သားများတည်ဆောက်ရန်နှင့် ကြံ့ခိုင်မှုကို မြှင့်တင်ရန် အထောက်အကူပြုကြောင်း သက်သေပြထားသည်။ စက်ပစ္စည်း မလိုအပ်ပါ၊ မကြာမီ ရလဒ်များကို မြင်ရပါမည်။",

  ///  Plan Test Description Strings
  'plan_test_desc_1': "ခြေချင်းဝတ်များကြားရှိ အကွာအဝေးသည် 1.5 စင်တီမီတာထက်ပို၍ ခြေထောက်များကို ဖြောင့်စေပြီး ဒူးများ နီးကပ်နေပါသည်။\n\nခြေထောက်များကို ဖြောင့်လိုက်သောအခါ ဒူးများ တစ်ဖက်နှင့်တစ်ဖက် ထိမိသည့် အခြေအနေတစ်ခု။",
  'plan_test_desc_2': "ဒူးနှစ်ဖက်ကြားအကွာအဝေးသည် သင့်ခြေဖဝါးချင်းနီးကပ်နေသည့်အခါ 3 စင်တီမီတာထက် ပိုပါသည်။\n\nဒူးကို အပြင်သို့ငုံ့ထားခြင်းဖြင့် ခြေထောက်ကို ပေါင်၏ဝင်ရိုးနှင့်ဆက်စပ်၍ အတွင်းဘက်သို့ စောင်းထားကြောင်း ဆိုလိုသည်မှာ ခြေတံကို ခြုံငုံထားခြင်းဖြစ်သည်။ လေးသမား၏ပုံသဏ္ဌာန်၊",

  ///  Plan Short Description Strings
  'plan_short_desc_5': "ဤစက်ရှင်ရှိ လေ့ကျင့်ခန်းများသည် သင့်ခန္ဓာကိုယ်၏ ကြွက်သားတစ်ခုစီတိုင်းကို အကျိုးသက်ရောက်စေပြီး လေ့ကျင့်ခန်းရလဒ်ကို အမြင့်ဆုံးဖြစ်စေပြီး သင်၏ အလုံးစုံကြံ့ခိုင်မှုကို တိုးတက်စေသည်။",
  'plan_short_desc_6': "သင့်တင်ပါးနှင့် ခြေထောက်များကို ထောင့်ပေါင်းစုံမှ ပစ်မှတ်ထားပြီး သင့်အား လှပသောပုံစံနှင့် သွယ်လျသောခြေထောက်များကို သင်ထင်ထားသည်ထက် ပိုမိုမြန်ဆန်စွာရရှိစေရန် ကူညီပေးသည်။",
  'plan_short_desc_7': "လှပတဲ့ ဗိုက်သားကို မြင်ချင်တဲ့သူတွေအတွက်ပါ။ စတင်သူနှင့် လေ့ကျင့်ခန်းစစ်သည်များ နှစ်မျိုးလုံးနှင့် လိုက်ဖက်သည်။",
  'plan_short_desc_8': "လက်မောင်းအဆီအမြန်လောင်ကျွမ်း။ ပါးလွှာပြီး သင့်လက်မောင်းများကို သင့်ခန္ဓာကိုယ်အလေးချိန်ဖြင့် ပုံဖော်ပါ။",
  'plan_short_desc_9': "နိုးထပြီး အားအင်နဲ့ နိုးထပါ၊ သင့်ခန္ဓာကိုယ်ကို နေ့စဥ်ပြုလုပ်ပါ။",
  'plan_short_desc_10': "သင့်ကိုယ်သင် အနားယူပြီး အရည်အသွေးမြင့် အိပ်စက်အနားယူပါ။",
  'plan_short_desc_11': "အမျိုးသမီးများ ခါးကောက်ခြင်းကို သက်သာစေရန် အထူးပြုလုပ်ထားသော 7 မိနစ် လေ့ကျင့်ခန်း။ ဤလေ့ကျင့်ခန်းသည် သင့်တင်ပါး၊ ဗိုက်၊ ခြေထောက်စသည်တို့ကို ဖုံးအုပ်ပေးသည်။",
  'plan_short_desc_12': "အထိရောက်ဆုံး တစ်ကိုယ်လုံး လေ့ကျင့်ခန်း။ ပြားချပ်ချပ်ဗိုက်၊ သွယ်လျသောဖိနပ်နှင့် တင်းကြပ်သော\nခြေထောက်များဖြင့် ပိုမိုဆွဲဆောင်မှုရှိသော ခန္ဓာကိုယ်ရရှိရန် တစ်ရက်လျှင် 7 မိနစ်သာ အချိန်ပေးပါ။",
  'plan_short_desc_13': "ကြွက်သားတွေကို ပြေလျော့စေပြီး နာကျင်မှုကို သက်သာစေပါတယ်။",
  'plan_short_desc_14': "ကိုယ်အလေးချိန်လျှော့ချရန်အတွက် ညစာစားပွဲတွင် ထိရောက်သောပြင်းထန်သောလေ့ကျင့်ခန်း။ တစ်နေ့တာလုံး ကယ်လိုရီတွေကို လောင်ကျွမ်းစေနိုင်ပါတယ်။",
  'plan_short_desc_15': "ACSM သုတေသနကို အခြေခံ၍ ဒီဇိုင်းထုတ်ထားပြီး ကျန်းမာကြံ့ခိုင်မှုနှင့် ကျန်းမာရေးကို မြှင့်တင်ပေးသည်။",
  'plan_short_desc_16': "အဆီလောင်ကျွမ်းမှုအတွက် အထိရောက်ဆုံး လေ့ကျင့်ခန်း။ ပြင်းထန်မှု\nလေ့ကျင့်ခန်းများသည် မိနစ် 30 ကြာပြီးနောက် ဇီဝဖြစ်စဉ်နှုန်းကို နှစ်ဆတိုးစေသည်။ 4\nမိနစ်သာ၊ ဆင်ခြေမရှိပါ။",
  'plan_short_desc_17': "သင့်ခန္ဓာကိုယ်ပြည့်ပြည့်အတွက် ပြင်းထန်မှုပြင်းထန်သော လေ့ကျင့်ခန်းသည် \nအေရိုးဗစ်လေ့ကျင့်ခန်းနှင့် ပေါင်းစပ်ပြီး Victoria's Secret\nမော်ဒယ်ကဲ့သို့ အသွင်သဏ္ဍာန်ရရှိရန် ကူညီပေးပါသည်။",
  'plan_short_desc_18': "10 မိနစ်အတွင်း ကယ်လိုရီ 100 လောင်ကျွမ်းစေပါသည်။ ပြင်းထန်သောလေ့ကျင့်ခန်းဖြင့် စွမ်းဆောင်ရည်ကို မြှင့်တင်ပါ။",
  'plan_short_desc_19': "မြန်ဆန်ထိရောက်မှု။ 1 0 မိနစ်မျှသာ ကယ်လိုရီလောင်ကျွမ်းမှုကို တိုးမြှင့်\nပြီး ပြင်းထန်သော လေ့ကျင့်ခန်းဖြင့် သင့်ခန္ဓာကိုယ် တစ်ခုလုံးကို လေ့ကျင့်ပါ။",
  'plan_short_desc_20': "ပြင်းထန်သော ပြင်းထန်သော လေ့ကျင့်ခန်းများက သင့်အား \nကယ်လိုရီများကို ပိုလောင်ကျွမ်းစေပါသည်။ အတွေ့အကြုံရှိ လေ့ကျင့်ခန်း\nစစ်သည်များအတွက် ရက်စက်ကြမ်းကြုတ်သော အဆီလောင်ကျွမ်းစေသော လေ့ကျင့်မှု။",
  'plan_short_desc_21': "မင်းရဲ့အမိုက်စားကို ပစ်မှတ်ထားပြီး မင်းရဲ့ sexy ကောက်ကြောင်းတွေကို ချဲ့ထွင်ဖို့ ပေါင်အကြောပြင်လေ့ကျင့်ခန်းကို ပေါင်းစပ်လိုက်ပါ။",
  'plan_short_desc_22': "ခုန်မနေနဲ့! သင့်\nခြေထောက်များကို ပုံသွင်းရန် အကျိုးသက်ရောက်မှုနည်းသော လေ့ကျင့်ခန်း။ ဆူညံသံမရှိ တိုက်ခန်းဖော်ရွေသည်။",
  'plan_short_desc_23': "ဘရာဇီး ဖင်က အိပ်မက်မဟုတ်တော့ဘူး။ ပိုပို၍သွယ်သွယ်နှင့် ပိုကြီးသောကိုယ်ထည်ကိုရရှိရန် သင့်တင်ပါး\nကိုထောင့်ပေါင်းစုံမှ လှုံ့ဆော်ပါ။",
  'plan_short_desc_24': "3 မိနစ်သာ ချက်ခြင်းလေ့ကျင့်ခန်း။ သင်၏အရူးအမူးအလုပ်များသည့်အချိန်ဇယားများကြားမှ လှပသောတင်ပါးကို အမှတ်ပေးလိုက်ပါ။",
  'plan_short_desc_25': "ပေါင်အကွာအဝေးကို လိုချင်ပါသလား။ ပစ်မှတ်ထားသော လေ့ကျင့်ခန်းများသည် ပေါင်အတွင်းပိုင်းရှိ အဆီများကို လောင်ကျွမ်းစေပါသည်။ စတင်သူတိုင်း အဆင်ပြေပါစေ။",
  'plan_short_desc_26': "သင့်ပေါင်အဆီတွေကို အာရုံစိုက်ပါ၊ အကောင်းဆုံးလေ့ကျင့်ခန်းက သင့်ခြေထောက်နဲ့ တင်ပါးတွေကို တင်းကျပ်စေပါတယ်။ ဘီကီနီကို အဆင်သင့်ပြင်ထားပါ။",
  'plan_short_desc_27': "ပေါင်အဆီတွေကို 7 မိနစ်အတွင်း လောင်ကျွမ်းစေပါတယ်။ သက်ရောက်မှုနည်းသော လေ့ကျင့်ခန်းသည်\nဒူးအားနည်းသူများပင် လူတိုင်းအတွက် သင့်လျော်သည်။",
  'plan_short_desc_28': "ပြင်းထန်သော လေ့ကျင့်ခန်းသည် ပေါင်အတွင်းပိုင်းရှိ အဆီများကို လောင်ကျွမ်းစေပါသည်။ ကြွက်သားများမရှိပါ",
  'plan_short_desc_29': "၇ မိနစ် အမြန် လေ့ကျင့်ခန်းလုပ်ပါ။ အချိန်တိုအတွင်း သင့်တင်ပါးကို တင်းကြပ်ပါ။",
  'plan_short_desc_30': "ပြင်းထန်သော လေ့ကျင့်ခန်းများသည် သင့်တင်ပါးကို ပူလောင်စေသည် ။ အထိရောက်ဆုံးနည်းလမ်းဖြင့် သင့်တင်ပါး၏အကွေးကို တိုးပါ။",
  'plan_short_desc_31': "စိတ်လျှော့ပြီး လိုက်လျောညီထွေဖြစ်အောင် ဖန်တီးပါ။ ပြေးခြင်းနှင့် လေ့ကျင့်ခန်းလုပ်ခြင်းအတွက် အကြောဆန့်ခြင်းသည်လည်း ကောင်းမွန်သည်။",
  'plan_short_desc_32': "စိတ်လျှော့ပြီး လိုက်လျောညီထွေဖြစ်အောင် ဖန်တီးပါ။ ပြေးခြင်းနှင့် လေ့ကျင့်ခန်းလုပ်ခြင်းအတွက် အကြောဆန့်ခြင်းသည်လည်း ကောင်းမွန်သည်။",
  'plan_short_desc_33': "နာကျင်မှုကို သက်သာစေပြီး အားနည်းသော ဒူးခေါင်းများကို သန်မာစေသည်။",
  'plan_short_desc_34': "Foam Roller ဖြင့် ဒူးနာခြင်းကို ထိရောက်စွာ သက်သာပျောက်ကင်းစေပါသည်။",
  'plan_short_desc_35': "ပရော်ဖက်ရှင်နယ် ကာယကုထုံးပညာရှင်များမှ ဒီဇိုင်းထုတ်ထားသော အထူးလေ့ကျင့်ခန်းများသည် ဒူးခေါက်ခြင်းကို ပြုပြင်ရန်နှင့် သင်၏သွားရာလမ်းကြောင်းကို ပြုပြင်ရန် ရည်ရွယ်သည်။",
  'plan_short_desc_36': "ပရော်ဖက်ရှင်နယ် ကာယကုထုံးပညာရှင်များမှ ဒီဇိုင်းထုတ်ထားသော အထူးလေ့ကျင့်ခန်းများသည် ခြေထောက်လေးကို ပြုပြင်ရန်နှင့် သင်၏သွားရာလမ်းကြောင်းကို ပြုပြင်ရန် ရည်ရွယ်သည်။",
  'plan_short_desc_37': "ရိုးရှင်းသောလေ့ကျင့်ခန်း 4 ခုသာ။ ဗိုက်သားအဆီတွေကို လောင်ကျွမ်းစေပြီး ဗိုက်သားကို တင်းတင်းရင်းရင်းဖြစ်စေပါတယ်။ မြန်မြန် ဗိုက်ချပ်လာပါစေ။",
  'plan_short_desc_38': "ဗိုက်သားအဆီများကို လောင်ကျွမ်းစေပြီး ပျဉ်ပြားများဖြင့် ကြော်ငြာထည့်ပါ။ လည်ပင်းနှင့် နောက်ကျော ဒဏ်ရာများကို လျှော့ချပါ။",
  'plan_short_desc_39': "ဗိုက်အဆီတွေကို လောင်ကျွမ်းစေပြီး တင်ပါးကို တင်းရင်းစေပါတယ်။ အားစိုက်ထုတ်မှုနည်း၍ ပိုမိုသိမ်းဆည်းပါ။",
  'plan_short_desc_40': "ဗိုက်သားကိုမြင်နိုင်စေရန် တစ်ရက်လျှင် 7 မိနစ်ခန့် တိုတိုနှင့် လွယ်ကူသော လေ့ကျင့်ခန်းဖြင့် စတင်လိုက်ပါ။ ဆင်ခြေမလိုချင်ဘူး!",
  'plan_short_desc_41': "အူတိုင်ကြွက်သားများ အားကောင်းရန်နှင့်\nတည်ငြိမ်မှုကို တိုးတက်စေရန်အတွက် အဆုံးစွန်သော လေ့ကျင့်ခန်းများ။ ပြင်းထန်သော လေ့ကျင့်ခန်းများသည် သင့်ဗိုက်သားကို လောင်ကျွမ်းစေလိမ့်မည် ။",
